import { GET_ALL_DOGS } from "../action-types";

const initialState = {
    dogs: [],
    allDogs: [],
}

export default function rootReducer (state = initialState, action) {
    switch (action.type) {
        case GET_ALL_DOGS: 
            return {
                ...state,
                dogs: action.payload,
                allDogs: action.payload,
            }
        default:
            return state;
    }
}
